import { Route, Routes } from 'react-router-dom';
import './App.css';
import NavBar from './Components/NavBar/NavBar';
import Home from './Pages/Home/Home';

function App() {
  return (
    <div className="App">
<NavBar/>
<Routes>
  <Route path='/' element={<Home/>} />
  <Route path='/About' element={<Home/>} />
  <Route path='/' element={<Home/>} />
  <Route path='/' element={<Home/>} />
</Routes>
    </div>
  );
}

export default App;
